if (!defined('BASEPATH')) {
    exit('No direct script access allowed');
}

class LoginModal extends CI_Model {

    function __construct() {
        parent::__construct();
    }

    public function login($data) {
        $this->db->from('login_details as a');
        $this->db->select('a.*');
        $this->db->where($data);
        $query = $this->db->get();
        return $query->result_array();
    }
    public function get_all_images() {
        $result = $this->db->select('*')->get_where('gallery', ['deleted_at' => NULL]);
        return $result;
    }

    public function get_images_by_category($category_type) {
        $result = $this->db->select('*')->get_where('gallery', ['deleted_at' => NULL, 'image_category' => $category_type]);
        return $result;
    }

    public function get_cources() {
        $result = $this->db->select('*')->get_where('courses', ['status' => 1]);
        return $result->result_array();
    }

    public function get_cources_year($id) {
        $result = $this->db->select('*')->get_where('student_details', ['course_name' => $id,'deleted_at' => NULL]);
        return $result->result_array();
    }

    public function get_faculty($id) {
        $result = $this->db->select('*')->get_where('faculty', ['deleted_at' => NULL, 'course_name' => $id]);
        return $result;
    }

    public function get_course($id) {
        $result = $this->db->select('*')->get_where('courses', ['id' => $id]);
        return $result->row();
    }
}
